    false,nt"url": null,nt"notes": "This annual narrative report for Montezuma
    National Wildlife Refuge  outlines Refuge accomplishments during the 1993 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, grasslands, fire management, and pest control. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
    resources, wildlife propagation, animal control, marking and banding, and disease
    control. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, computer systems, and energy conservation. Economic uses
    of the Refuge and items of interest are provided at the end. Refuge brochures are
